import React from 'react';

import classes from './RadioButton.module.css';

const radiobutton = (props) => {
  return (
      <label className={classes.custom-radio-btn} class="custom-radio-btn">
      <input  className={classes.RadioButton} type="radio" name="Testradio" vale="Testradio1"/>
      <span className={classes.checkmark} class="checkmark"></span>
      </label>
  );
}

export default radiobutton;
